import React from "react";

const Navbar = () => {
  return (
    <>
      <div class="flex justify-end px-10 ">
        <p class="p-5 text-md">Home</p>
        <p class="p-5 ">About</p>
        <p class="p-5 ">Portfolio</p>
        <p class="p-5 ">Contact</p>
      </div>
    </>
  );
};

export default Navbar;
